import { createMuiTheme } from '@material-ui/core/styles';

export const theme = createMuiTheme({
  palette: {
    primary:{
      main: '#f44336',
     },
    contrastThreshold: 3,
    tonalOffset: 0.2,
  },
});

export const darkTheme = createMuiTheme({
  palette: {
    primary:{
      main: '#f44336',
     },
    contrastThreshold: 3,
    tonalOffset: 0.2,
  },
});
